<body>
<h2>Dynamic Page Content GO</h2>
<div><a href="index.html?pg=1">Page 1</a> | <a href="index.html?pg=5">Page 5</a> | <a href="index.html?pg=10">Page 10</a> | <a href="index.html?pg=x">Error Page</a></div>
<hr/>
<div id="pg"></div>
<hr/>
<div><a href="index.html?pg=1">Page 1</a> | <a href="index.html?pg=5">Page 5</a> | <a href="index.html?pg=10">Page 10</a> | <a href="index.html?pg=x">Error Page</a></div>
<br/><br/><br/>
<script>
$(document).ready(function(){

	var urlq = qryparams();
	if(urlq.pg){
	   if(itms[urlq.pg]){
	      loaditems(itms[urlq.pg],urlq.pg);
	   }else{
	   	$("#pg").append('<h3>Error</h3>');
	   }
	}else{
	   loaditems(itms[1],1);
	}
	
	$("a").each(function(){
		var h = $(this).attr("href");
		$(this).attr("href",h + '&r=' +(new Date).getTime());
	});

});

function loaditems(itm,pgid){
   $.each(itm,function(idx,val){
      $("#pg").append('<p><b>Page Num: ' + pgid + '</b> ' + val.f + '</p><div>' + val.t + '</div>');
   });
}

function qryparams(){
   var url = window.location.href;
   var qs = url.substring(url.indexOf('?') + 1);
   var p = qs.split('&');
   var qobj = {};
   var tmp;
   $.each(p,function(idx,val){
      tmp = val.split('=');
      if(tmp.length == 2){
         qobj[tmp[0]] = tmp[1];
      }
   });   
   return qobj;
}
</script>
